INSERT INTO `events` (`id`, `name`, `type`, `reg_cost`, `pic`, `imgType`, `start`, `end`, `reg_start`, `reg_end`, `state`, `city`, `loc`, `org`, `prize1`, `prize2`, `prize3`, `min`, `max`, `desc`, `rules`, `want_reg`, `is_big`, `f_id`) VALUES
(8001001, 'U Hack', 'Hackathon', 150, , 'image/webp', '2024-03-03 08:00:00', '2024-03-04 23:34:00', '2024-03-01 00:00:00', '2024-03-05 07:20:00', 'gujarat', 'Ahemdabad', 'Nirma University', 'Nirma University', '2500', '1500', '1000', 1, 5, 'Participate in our hackathon & win big from a ₹20,00,000 prize pool. Plus, get all the support & guidance you need to launch your startup. This is an opportunity you dont want to miss!\r\n\r\nKick offs with a two-month idea phase, followed by a month-long Online Hackathon. The Online Hackathon also features Offline Buidl Stations/Meetups across India to bring together the smart minds to build groundbreaking dApps on the Internet Computer Protocol (ICP). We Crewsphere: ICP India Hub organizing this', 'Team size is 1 - 5 members. You can either invite your friends to form a team or you can request other teams to add you as a member.\r\n\r\nThe Project must built on the Internet Computer (ICP).\r\n\r\nPrize money will only be awarded to the projects that uniquely leverage ICP technology & fills a gap in the ICP ecosystem in terms of usages of the tech. Mediocre projects will not be rewarded.\r\n\r\nMust submit working Project deployment link.\r\n\r\nIts an online hackathon, you can participate from anywhere. ', 1, 1, 2003005);
INSERT INTO `events` (`id`, `name`, `type`, `reg_cost`, `pic`, `imgType`, `start`, `end`, `reg_start`, `reg_end`, `state`, `city`, `loc`, `org`, `prize1`, `prize2`, `prize3`, `min`, `max`, `desc`, `rules`, `want_reg`, `is_big`, `f_id`) VALUES
(8001002, 'Quasar', 'Hackathon', 1000, , 'image/webp', '2024-03-21 08:00:00', '2024-03-22 14:00:00', '2024-02-29 00:00:00', '2024-03-07 00:00:00', 'Gujarat', 'Ahmedabad', 'L.D. college of engi', 'L.D. college', '100000', '50000', '30000', 1, 7, 'Overview\r\nThe adoption of Artificial Intelligence (AI), particularly Generative AI, within organizations has many potential benefits, but it s critical for these advancements and adoption to occur responsibly and safely to avoid harmful outcomes. Organizations need a solution to monitor and control AI usage, such as the use of ChatGPT, to prevent misuse, ensure compliance, and mitigate potential risks.\r\n\r\nTask\r\nDevelop a solution to ensure the responsible use of Generative AI, specifically Open', 'This is a team participation hackathon. You can have at most 4 members in your team.\r\n\r\nYou can either invite your friends to form a team or you can request other teams to add you as a member.\r\n\r\nThe hackathon will start at March 28, 2024 06:00 PM IST (Asia/Kolkata) and end at April 9th, 2024 11:55 PM IST (Asia/Kolkata), you work on your hack during the allotted time only.\r\n\r\nIt s an online hackathon, you can participate from anywhere.\r\n\r\nYour hack must be developed entirely during the Hackathon', 1, 1, 2003001);
INSERT INTO `events` (`id`, `name`, `type`, `reg_cost`, `pic`, `imgType`, `start`, `end`, `reg_start`, `reg_end`, `state`, `city`, `loc`, `org`, `prize1`, `prize2`, `prize3`, `min`, `max`, `desc`, `rules`, `want_reg`, `is_big`, `f_id`) VALUES
(8001003, 'Tech-a-thon', 'Hackathon', 200, , 'image/webp', '2024-03-30 08:00:00', '2024-04-02 14:00:00', '2024-02-01 00:00:00', '2024-03-06 00:00:00', 'Gujarat', 'Bhavnagar', 'GEC, Bhavnagar', 'GEC, Bhavnagar', '10000', '5000', '2500', 2, 6, 'Hackathon Problem Statements\r\nThere are three exciting problem statements for young innovators to tackle.\r\n\r\nFirstly, participants will develop trustless infrastructure for AI using zero-knowledge proofs and zk-SNARKs to ensure secure and private AI networks. Secondly, the challenge is to create an AIGC enchanted Web 3 ecosystem to revolutionize the gaming industry, with a focus on gaming, content generation, and AI-based apps. Lastly, participants will build an AI marketplace that enables secur', 'This is a team participation hackathon. You can have at most 5 members in your team.\r\n\r\nYou can either invite your friends to form a team or you can request other teams to add you as a member.\r\n\r\nThe hackathon will start at Aug 12, 2023 10:00 AM HKT and end at Sep 18, 2023 11:55 PM HKT\r\n\r\nThis is an online hackathon, you can participate from anywhere in the world.\r\n\r\nThere are 3 themes of the hackathon, you must submit a hack that is in one of these themes.\r\n\r\nOnce the hackathon starts, you will', 1, 1, 2003005),
(8001004, 'Cyclotron', 'culture Event', 0, , 'image/png', '2024-03-07 09:00:00', '2024-03-07 12:00:00', '2024-03-02 00:00:00', '2024-03-05 08:00:00', 'West bengal', 'Kharagpur', 'IIT Kharagpur campus', 'IIT Kharagpur', '', '', '', 1, 1, 'It is a culture event for say no to smoking. event for spreading awareness.', '1. wear white tshirt.\r\n2. bring your cycle.', 1, 0, 2003002),
(8001005, 'Walkathon', 'culture Event', 0, , 'image/jpeg', '2024-03-07 14:00:00', '2024-03-07 15:00:00', '2024-03-02 00:00:00', '2024-03-09 00:00:00', 'West bengal', 'Kharagpur', 'IIT Kharagpur campus', 'IIT Kharagpur ', '', '', '', 1, 1, 'It is a culture event for say no to smoking. event for spreading awareness.', '1. wear white tshirt.', 1, 0, 2003002);

