(3003002, 'Intelligent Animal Surveillance \r\nand Monitoring System', 'The Intelligent Animal Surveillance and Monitoring \r\nSystem is designed to provide a comprehensive \r\nsolution for monitoring and safeguarding wildlife \r\nhabitats. This project aims to leverage modern \r\ntechnologies to ensure the well-being of animals, \r\nprevent poaching, and contribute to conservation \r\nefforts.', 0, 2003001, 8001001),
